            __builder.AddMarkupContent(14, "<div class=\"main\"><p>A binary number is a number expressed in the base-2 numeral system or binary numeral system, a method of mathematical expression which uses only two symbols: typically \"0\" (zero) and \"1\" (one).</p>\r\n\t\t\t\t\t<p><span style=\"color:green;\"><b>Binary counting</b></span></p>\r\n\t\t\t\t\t<p>Binary counting follows the same procedure as decimal counting, except that only the two symbols 0 and 1 are available. Thus, after a digit reaches 1 in binary, an increment resets it to 0 but also causes an increment of the next digit to the left. Overview of binar numebrs representing numbers 0-12 in decimal system is presented in table below.</p>\r\n\t\t\t\t\t<table class=\"t1\" style=\"margin-left:auto;margin-right:auto;\"><tr class=\"t1\"><td class=\"t1 tableheader\"><b>Decimal numebrs</b></td>\r\n\t\t\t\t\t\t\t<td class=\"t1 tableheader\">&nbsp&nbsp&nbsp<b>Binary numbers</b></td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">0</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">0</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">1</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">2</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">10</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">3</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">11</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">4</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">100</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">5</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">101</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">6</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">110</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">7</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">111</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">8</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1000</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">9</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1001</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">10</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1010</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">11</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1011</td></tr>\r\n\t\t\t\t\t\t<tr class=\"t1\"><td class=\"t1\">12</td>\r\n\t\t\t\t\t\t\t<td class=\"t1\">1100</td></tr></table>\r\n\t\t\t\t\t<p></p>\r\n\t\t\t\t\t<p><span style=\"color:green;\"><b>Binary to decimal conversion</b></span></p>\r\n\t\t\t\t\t<p>For binary number with n digits:</p>\r\n\t\t\t\t\t<p>d<sub>n-1</sub>... d<sub>3&nbsp</sub>d<sub>2&nbsp</sub>d<sub>1&nbsp</sub>d<sub>0&nbsp</sub></p>\r\n\t\t\t\t\t<p>The decimal number is equal to the sum of binary digits (dn) times their power of 2 (2<sup>n</sup>):</p>\r\n\t\t\t\t\t<p>decimal = d<sub>0</sub>x2<sup>0</sup> + d<sub>1</sub>x2<sup>1</sup> + d<sub>2</sub>x2<sup>2</sup> + ...</p>\r\n\t\t\t\t\t<p><b>Example</b></p>\r\n\t\t\t\t\t<table class=\"table2\" style=\"margin-left:auto;margin-right:auto;\"><tr><td class=\"table2 tableheader\" style=\"text-align:left;padding-top:5px; padding-bottom:5px;\"><b>binary number:&nbsp&nbsp</b></td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">1</td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">0</td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">0</td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">1</td></tr>\r\n\t\t\t\t\t\t<tr><td class=\"table2 tableheader\" style=\"text-align:left; padding-top:5px; padding-bottom:5px;\"><b>power of 2:&nbsp&nbsp</b></td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">2<sup>3</sup></td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">2<sup>2</sup></td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">2<sup>1</sup></td>\r\n\t\t\t\t\t\t\t<td class=\"table2\">2<sup>0</sup></td></tr></table>\r\n\t\t\t\t\t<p></p>\r\n\t\t\t\t\t<p><span style=\"color:green;\"><b>Decimal to binary conversion</b></span></p>\r\n\t\t\t\t\t<p>Conversion steps:</p>\r\n\t\t\t\t\t<ul><li>Divide the number by 2.</li>\r\n\t\t\t\t\t\t<li>Get the integer quotient for the next iteration.</li>\r\n\t\t\t\t\t\t<li>Get the remainder for the binary digit.</li>\r\n\t\t\t\t\t\t<li>Repeat the steps until the quotient is equal to 0.</li></ul>\r\n\t\t\t\t\t<p>Convert 13 to binary:</p>\r\n\t\t\t\t\t<table style=\"margin-left:auto;margin-right:auto; \"><tr><td class=\"td3 tableheader\"><b>Division by 2</b></td>\r\n\t\t\t\t\t\t\t<td class=\"td3 tableheader\"><b>Quotient</b></td>\r\n\t\t\t\t\t\t\t<td class=\"td3 tableheader\"><b>Remainder</b></td></tr>\r\n\t\t\t\t\t\t<tr><td class=\"td3\">13/2</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\">6</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\" style=\"background-color:#FFF5EE\">1</td></tr>\r\n\t\t\t\t\t\t<tr><td class=\"td3\">6/2</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\">3</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\" style=\"background-color:#FFF5EE\">0</td></tr>\r\n\t\t\t\t\t\t<tr><td class=\"td3\">3/2</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\">1</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\" style=\"background-color:#FFF5EE\">1</td></tr>\r\n\t\t\t\t\t\t<tr><td class=\"td3\">1/2</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\">0</td>\r\n\t\t\t\t\t\t\t<td class=\"td3\" style=\"background-color:#FFF5EE\">1</td></tr></table>\r\n\t\t\t\t\t<p></p>\r\n\t\t\t\t\t<p>So 13 as a decimal numebrs equals 1101 as a binary number.</p></div>\r\n\t\t\t\t<div class=\"right\"></div>");
